import React from 'react';
import ReactDOM from 'react-dom';
import { GlobalStyle } from './global-styles';
import App from './App';


ReactDOM.render(
  <React.StrictMode>
    <GlobalStyle/>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
